import React from "react";
import "./styles.css";

const EmailComponent = (props) => {
  console.log(props, "this is my props");
  const updateValue = (e) => {
    props.onChange(e.target.value);
  };

  return (
    <div>
      <input
        className="Layout"
        type="text"
        placeholder="Enter an email"
        value={props.value}
        onChange={(e) => updateValue(e)}
      />
    </div>
  );
};

export default EmailComponent;
